import React from 'react'
import { Link } from 'react-router-dom'
import { Navbar,Textinput, TextinputLogin } from '../../conponents'

import './login.css'


const LoginPage = () => {
  return (
       <><Navbar /><div className='main-bg'>
      <TextinputLogin />
      <Link to={'/Signup'}><p>Signup</p></Link>
    </div></>
  )
}

export default LoginPage
